CREATE TABLE `hoo_memory_media` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `user_id` bigint NOT NULL,
  `message_id` bigint DEFAULT NULL,
  `media_type` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '''0 - image'',''1 - video''',
  `media_name` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Store name of video',
  `media_extension` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Store extension',
  `media_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci,
  `media_thumbnail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci,
  `description` text,
  `caption` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci,
  `likes` int NOT NULL DEFAULT '0' COMMENT 'Count for likes',
  `views` int NOT NULL DEFAULT '0',
  `status` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '0' COMMENT '0 - Active, 1 - Inactive',
  `lat` decimal(10,8) NOT NULL,
  `long` decimal(10,8) NOT NULL,
  `address` varchar(225) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `is_delete` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '0' COMMENT '0 - Record Exists , 1 - Record Deleted',
  `goldstar` varchar(255) DEFAULT NULL,
  `report` int DEFAULT NULL,
  `fire` bigint DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=365 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
