CREATE TABLE `hoo_users` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) NOT NULL,
  `last_name` varchar(100) NOT NULL,
  `dob` date NOT NULL,
  `gender` enum('','1','2') NOT NULL DEFAULT '' COMMENT '''1''-''Male'',''2''-''Female''',
  `phone_number` varchar(50) NOT NULL,
  `country_code` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `email` varchar(100) NOT NULL,
  `username` varchar(50) NOT NULL,
  `password` text NOT NULL,
  `latitude` varchar(10) NOT NULL,
  `longitude` varchar(10) NOT NULL,
  `city` varchar(100) NOT NULL,
  `profile_image` text,
  `account_type` enum('0','1','2') NOT NULL COMMENT '''0 - Normal User'',''1 - Business User'',''2 - Premium User''',
  `biography` text,
  `website` varchar(255) DEFAULT NULL,
  `catid` int DEFAULT NULL,
  `is_vip` enum('0','1') NOT NULL COMMENT '''0 - Not VIP'',''1 - VIP''',
  `terms_and_conditions` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '1' COMMENT '''0'' - ''Accept'',''1'' - ''Decline''',
  `is_verified` enum('0','1') NOT NULL DEFAULT '0' COMMENT '''0''-''User Not Verified'',''1'' - ''User Verified''',
  `otp` int DEFAULT NULL,
  `wallet` float(10,2) DEFAULT '0.00',
  `payment_status` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '0' COMMENT '''0'' - ''Payment Pending'',''1'' - ''Payment Completed''',
  `package_id` int NOT NULL DEFAULT '0',
  `is_trial_completed` enum('0','1') DEFAULT '0' COMMENT '''0'' - ''No'', ''1'' - ''Yes''',
  `account_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `bank_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `account_holder` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci,
  `bank_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `swift_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime DEFAULT NULL,
  `is_delete` enum('0','1') NOT NULL COMMENT '''0'' - ''Record Exists'',''1'' - ''Record Deleted''',
  `banner` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=205 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
